&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;&lt;span style=&quot;font-size: 12pt; font-family: Helvetica, sans-serif;&quot;&gt;Place pumpkins and jack-o-lanterns in your Yard Waste.&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;font-size: 12pt; font-family: Helvetica, sans-serif;&quot;&gt;Yard waste in plastic bags will not be collected.&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;font-size: 12pt; font-family: Helvetica, sans-serif;&quot;&gt;Use kraft paper bags from October to March as items may freeze to containers.&lt;/span&gt;&lt;/li&gt;
&lt;li&gt;&lt;span style=&quot;font-size: 12pt; font-family: Helvetica, sans-serif;&quot;&gt;If you do not have other Yard Waste, cut pumpkin in quarters and put in your Green Bin.&lt;/span&gt;&lt;/li&gt;
