&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;This item is&amp;nbsp;&lt;a href=&quot;https://www.toronto.ca/services-payments/recycling-organics-garbage/household-hazardous-waste/&quot; target=&quot;_self&quot;&gt;Household Hazardous Waste (HHW)&lt;/a&gt; and MUST NOT be placed in your Garbage Bin, Blue Bin or Green Bin.&lt;/li&gt;
&lt;li&gt;Please take this item to one of the City&#x27;s &lt;a href=&quot;http://www.toronto.ca/garbage/depots.htm&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Drop-Off Depots&lt;/a&gt;&amp;nbsp;or &lt;a href=&quot;http://www.toronto.ca/environment_days/index.htm&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt; Community Environment Days&lt;/a&gt;.&lt;/li&gt;
&lt;li&gt;For HHW between 10 to 50 litres/kilograms, residents can also request a free Toxic Taxi pick-up &lt;a href=&quot;https://secure.toronto.ca/webwizard/html/household_hazardous_waste.htm&quot;&gt;online&lt;/a&gt; or by calling 311.&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Place this item in your Yard Waste.&lt;/li&gt;
&lt;li&gt;Yard waste in plastic bags will not be collected.&lt;/li&gt;
&lt;li&gt;Use kraft paper bags from October to March as items may freeze to containers.&amp;nbsp;&lt;/li&gt;
&lt;li&gt;Leave your grass clippings on your lawn; yard waste containing grass clippings or sod will not be collected.&lt;/li&gt;
&lt;li&gt;Please place poisonous and invasive plants in your Garbage Bin.&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Paint is&amp;nbsp;&lt;a href=&quot;https://www.toronto.ca/services-payments/recycling-organics-garbage/household-hazardous-waste/&quot; target=&quot;_self&quot;&gt;Household Hazardous Waste (HHW)&lt;/a&gt;&amp;nbsp;and MUST NOT be placed in your Garbage Bin, Blue Bin, Green Bin or put down the drain/toilet/sewer.&lt;/li&gt;
&lt;li&gt;Please take this item to one of the City&#x27;s&amp;nbsp;&lt;a href=&quot;http://www.toronto.ca/garbage/depots.htm&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Drop-Off Depots&lt;/a&gt;&amp;nbsp;or&amp;nbsp;&lt;a href=&quot;http://www.toronto.ca/environment_days/index.htm&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Community Environment Days&lt;/a&gt;.&lt;/li&gt;
&lt;li&gt;For HHW between 10 to 50 litres/kilograms (approximately 3 to 14 cans of paint), residents can also request a free Toxic Taxi pick-up&amp;nbsp;&lt;a href=&quot;https://secure.toronto.ca/webwizard/html/household_hazardous_waste.htm&quot;&gt;online&lt;/a&gt;&amp;nbsp;or by calling 311.&lt;/li&gt;
&lt;li&gt;Residents can also check&amp;nbsp;&lt;a href=&quot;http://www.regeneration.ca/programs/paint/ontario/&quot;&gt;Ontario Paint Recycle Program&lt;/a&gt;&amp;nbsp;for additional collection sites.&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt; 
 &lt;li&gt;The City is presently under a federal order from the &lt;a href=&quot;http://www.inspection.gc.ca/about-the-cfia/newsroom/news-releases/2013-12-03/eng/1386096220998/1386096232915&quot; target=&quot;_blank&quot;&gt;Canadian Food Inspection Agency (CFIA)&lt;/a&gt; to quarantine an area in the northwest portion of the city (Finch on the north, Hwy 427 on the west, Dixon/Hwy 401 on the south and Martin Grove on the east).&lt;/li&gt; 
 &lt;li&gt;Woody material cannot be taken out of the area unless it has been ground to less than 5/8 of an inch and has been inspected and certified by CFIA personnel.&lt;/li&gt; 
 &lt;li&gt;Within this area City collections will be limited to material equal to or less than 7.5 centimeters (3 inches) in diameter.&lt;/li&gt; 
 &lt;li&gt;Material greater than 7.5 centimeters (3 inches) from the ALHB regulated area will be accepted at the &lt;a href=&quot;http://www.toronto.ca/garbage/depots.htm&quot; target=&quot;_blank&quot;&gt;Disco Drop-off Depot&lt;/a&gt;. Unauthorized movement of material can lead to fines up to $50,000.&lt;/li&gt; 
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Place item in the&amp;nbsp;&lt;strong&gt;Garbage Bin.&lt;/strong&gt;&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Large mirrors should be placed out in a safe manner for staff to collect.&lt;/li&gt;
&lt;li&gt;Break down into smaller pieces and securely wrap broken glass and sharp objects in newspaper before placing the items in the Garbage Bin.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;ul&gt; 
 &lt;li&gt;All wood waste, including that which is suffering from the emerald ash borer beetle, can be put to the curb as long as it does not exceed 7.5 cm (3 inches) in diameter.&lt;/li&gt; 
 &lt;li&gt;Securely tie hedge trimmings, brush or branches. Bundles can be up to 1.2 m (4ft.) in length and 0.6 m (2ft.) in width, weighing less than 20 kgs/44lbs.&lt;/li&gt; 
 &lt;li&gt;If items exceed 7.5 cm (3 inches) in diameter, please make arrangements with a private company specializing in handling this type of waste.&lt;/li&gt; 
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Set out electronic equipment at curbside on scheduled Garbage collection day. &amp;nbsp;&lt;/li&gt;
&lt;li&gt;Place these items for pick up 0.5 meter (2 feet) away from the&amp;nbsp;Garbage Bin.&lt;/li&gt;
&lt;li&gt;Large items can be put on the ground. Small items should be put in an open cardboard box or clear plastic bag.&lt;/li&gt;
&lt;li&gt;See our&amp;nbsp;&lt;a href=&quot;https://www.toronto.ca/services-payments/recycling-organics-garbage/electronic-waste/&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Electronics Waste&lt;/a&gt;&amp;nbsp;page for more information.&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt; 
 &lt;li&gt;This item is not collected curbside.&lt;/li&gt; 
 &lt;li&gt;Take this item to one of the City&#x27;s&amp;nbsp;&lt;a href=&quot;http://www.toronto.ca/garbage/depots.htm&quot; target=&quot;_blank&quot;&gt;Drop-Off Depot&lt;/a&gt;.&amp;nbsp;Please note disposal fees may apply.&lt;/li&gt; 
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Saturate a paper towel with the cooking oil, freeze it or let it harden, and then place it in their&amp;nbsp;&lt;strong&gt;Green Bin&lt;/strong&gt;.&lt;/li&gt;
&lt;li&gt;Used cooking oil should never be poured down the sink, drain or toilet because it can negatively impact the system of sewer pipes in your home and neighbourhood, causing sewer backups.&lt;/li&gt;
&lt;li&gt;Dispose of used cooking oil at a &lt;a href=&quot;http://www.toronto.ca/garbage/depots.htm&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Household Hazardous Waste Depots&lt;/a&gt; or at &lt;a href=&quot;http://www.toronto.ca/environment_days/index.htm&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Community Environment Days&lt;/a&gt;.&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;For cooking oil (liquid) between 10 to 50 litres/kilograms (no more than 20 litres per container), residents can also request a free Toxic Taxi pick-up &lt;a href=&quot;https://secure.toronto.ca/webwizard/html/household_hazardous_waste.htm&quot;&gt;online&lt;/a&gt; or by calling 311.&lt;/p&gt;
&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Place this item in your&amp;nbsp;&lt;strong&gt;Green Bin.&lt;/strong&gt;&lt;/li&gt;
&lt;li&gt;Line either your indoor container or outdoor Green Bin with a plastic bag or kraft paper bag. Do not line both.&lt;/li&gt;
&lt;/ul&gt;

&lt;ul&gt; 
 &lt;li&gt;Broken glass is a hazard and can injure you and the collector, tape cardboard or newspaper around the edges of broken glass.&lt;/li&gt; 
 &lt;li&gt;If the broken glass is from a jar or bottle please place it in the&amp;nbsp;&lt;strong&gt;Blue Bin&lt;/strong&gt;.&lt;/li&gt; 
 &lt;li&gt;If the broken glass is from a window pane or mirror please dispose of it in the&amp;nbsp;&lt;strong&gt;Garbage Bin.&lt;/strong&gt;&lt;/li&gt; 
&lt;/ul&gt;

&lt;ul&gt;
