 &lt;li&gt;Note: toilet tanks must be removed from bowl except for one piece toilets.&lt;/li&gt; 
&lt;/ul&gt;

&lt;ul&gt;
&lt;li&gt;Set out electronic equipment at curbside on scheduled Garbage collection day. &amp;nbsp;&lt;/li&gt;
&lt;li&gt;Place these items for pick up 0.5 meter (2 feet) away from the&amp;nbsp;Garbage Bin.&lt;/li&gt;
&lt;li&gt;Large items can be put on the ground. Small items should be put in an open cardboard box or clear plastic bag.&lt;/li&gt;
&lt;li&gt;See our&amp;nbsp;&lt;a href=&quot;https://www.toronto.ca/services-payments/recycling-organics-garbage/electronic-waste/&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Electronics Waste&lt;/a&gt;&amp;nbsp;page for more information.&lt;/li&gt;
&lt;/ul&gt;

